import React from "react";
import Todo from "./Todo";
function Todolist({ filtertodos, todos, setTodos }) {
  return (
    <div className="todo-container">
      <ul className="todo-list">
        {filtertodos.map((todo) => (
          <Todo
            todos={todos}
            setTodos={setTodos}
            text={todo.text}
            todo={todo}
            key={todo.id}
          />
        ))}
      </ul>
    </div>
  );
}

export default Todolist;
